import React from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";

const Navbar = () => {
  return (
    <nav className="navbar">
      <ul>
        <li>
          <Link to="/">HOME</Link>
        </li>
        <li>
          <Link to="/login">Login</Link>
        </li>
        <li>
          <Link to="/todo">YOUR-TO-DO LIST</Link>
        </li>
        <li>{/* <Link to="/todo">Todo</Link> */}</li>
      </ul>
    </nav>
  );
};

export default Navbar;
